import styled from 'styled-components';

export const Wrapper = styled.div`
    background-color: orange;
`;

export const List = styled.ul`
    margin: 0;
    padding: 0;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    list-style: none;
`;
